import React from "react"
import { useHistory} from 'react-router-dom';
import Forms from "./forms"

function App(){
    const history = useHistory()
    const Goto = function (){
        history.push('/forms')
    }
    return(
        <div>
            <button onClick={Goto}>Enter the Data</button>
        </div>
    )
}

export default App
